import React, { Component } from 'react';

class Add_company extends Component {
    constructor(){
        super()
        this.state = {
            fields: {},
            errors: {}
        }
    }
    render()
    {
        return(
            <div className="Add_company">
                <div id="sc-add-company">
                    <h1>Add Company Details</h1>
                    <div className="sc-container">
                        <form className="add_company_form">
                            <input type="text" placeholder="Name of Legal entity" />
                            <textarea placeholder="Address"></textarea>
                            <input type="text" placeholder="City" />
                            <input type="text" placeholder="PAN NO" />
                            <input type="text" placeholder="GST NO" />
                            <input type="text" placeholder="CIN NO" />
                            <input type="text" placeholder="Email Id" />
                            <input type="text" placeholder="Contact Number" />
                            <div>
                            <input type="submit" className="save" value="Save" />
                            <input type="submit" className="save_close" value="Save & Next" />
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        );
    }
}

export default Add_company;
